<h2>Dose Data Example</h2>

<h3>Description</h3>

<p>Dose data; a vector of length 12
with 3 observations for each of 4 doses.
</p>


<h3>Usage</h3>

<pre><code class="language-R">data(doseData)</code></pre>


<h3>Format</h3>

<p>The format is:
num [1:12] 1 1 1 2 2 2 3 3 ...
</p>


<h3>Examples</h3>

<pre><code class="language-R">
data(doseData)
  
doseData

</code></pre>
